import React, { Component } from "react";

class Register extends Component {
  constructor() {
    super();

    this.state = {
      page: 1,
      name: "mo"
    };
  }

  renderPage() {
    if (this.state.page == 1) {
      return (
        <div>
          <h1>Aplicant information </h1>
          <div className="field">
            <label> Email </label>
            <input type="text" />
          </div>
          <div className="field">
            <label> contact </label>
            <input type="text" />
          </div>
          <div className="field">
            <label> Pioneer </label>
            <input type="text" />
            </div>
            <div onChange={this.setGender.bind(this)}>
            <input type="radio" value="MALE" name="gender"/> Male
            <input type="radio" value="FEMALE" name="gender"/> Female
          </div>
        </div>
      );
    }
    if (this.state.page == 2) {
      return (
        <div>
          <div className="field">
            <label> city </label>
            <input type="text" />
            </div>
            <select class="option">
              <option>Country </option>
            </select>
            <div className="field">
            <label> place of birth </label>
            <input type="text" />
            </div>
        </div>
      );
    }
  }

  changePage() {
    const name = "mo";
    this.setState({ page: this.state.page + 1 });
  }

  render() {
    return (
      <div class="register">
        {this.renderPage()}
        <button className="btn" onClick={() => this.changePage()}> next </button>
      </div>
    );
  }
}

Register.propTypes = {};

export default Register;
